#include <vector>
#include <iostream>

using std::vector;

class Solution {
public:
    int numSubarrayProductLessThanK(vector<int> &nums, int k) {
        int ans = 0;
        for (int i = 0; i < nums.size();) {
            int product = 1;
            for (int j = i; j < nums.size(); ++j) {
                product *= nums[j];
                if (product >= k) {
                    break;
                }
                ++ans;
            }
        }
        return ans;
    }
};

